Composite tag for the [[horse costume]] contestant of the [[Japan World Cup]], including Haribote Elegy, Haribote Elegy 2.0, Haribote Elegy 3.0 and Mecha Haribote.

Each hailing from Japan, Haribote Elegy is a "horse" consisting of two runners wearing a papier-mâché horse costume. Haribote Elegy 2.0 is an upgrade from a fully papier-mâché body to a [[drum (container)|steel drum]] body with a papier-mâché head. Haribote Elegy 3.0 adds a third runner to the costume.

Hailing from America, Mecha Haribote is essentially a robot version of Haribote Elegy 2.0.

All versions of Haribote Elegy are prone to tripping and destroying themselves in mid-race in the first corner, effectively knocking themselves out...
[spoiler]Unless, respectively;
[spoiler]* Burning Beef knocks his jockey out and stops right before the finish line after knocking everyone else out but Haribote Elegy, who comes back up and continues running in [i]1[/i];
[spoiler]* Pink Pheromone leads the other racers into running in circles and Haribote Elegy 2.0 continues to run by rolling on their drum in [i]2[/i];
[spoiler]* Both in [i]3[/i], after surviving the mid-race, Haribote Elegy 3.0 produces a fourth runner and the jockey rows to victory;
[spoiler]** After the above, Mecha Haribote can possibly eliminate Haribote Elegy 3.0 by drilling it's back, leading [i]it[/i] to victory.[/spoiler][/spoiler][/spoiler][/spoiler][/spoiler]

